import "./CampoTexto.css";
export default function CampoTexto() {
  return (
    <>
      <section id="homebanner">
        <div className="container">
          <div className="row">
            <div className="col-12">
              <img src="./assets/img/banner.png" alt="Banner Principal" />
            </div>
          </div>
        </div>
      </section>
    </>
  );
}
